import React, { Fragment } from 'react'
import { withStyles } from '@material-ui/core/styles';
import Grid from '@material-ui/core/Grid'
import Card from '../Card'
import PlayerStats from "./PlayerStats"
import TextField from '@material-ui/core/TextField'



const styles = {
    card: {
      padding: 20,
    }
  };





class ComparePlayers extends React.Component {
    state = {
        player: [],
        Player1: "Muma",
        player2: "sinatraa"
    }


    componentWillMount() {
        this.getPlayers()
        console.log("Hello")
      }
    
    getPlayers = _ => {
        fetch('https://loclhost:4000/players')
        .then(response => response.json())
        .then(response => this.setState({ players: response.data}))
        .catch(err => console.error(err))
      }
    
    render() {
        return (
            <Fragment>
                <Grid container justify="center" alignItems="center" spacing={16}>
                    <Grid item>
                        <TextField
                          id="player1"
                          label="Player 1"
                          margin="normal"
                          defaultValue={this.state.player1}
                        />
                        {this.state.players.map((item, index) => {
                            if(item.Name === document.getElementById("player1").value) {
                                return <Card key={1} player={item}>{JSON.stringify(item)}</Card>
                            }
                        })}
                    </Grid>
            
                    <Grid item>
                        <TextField 
                            id="hero"
                            label="Hero"
                            margin="normal"
                            defaultValue="Tracer"
                        />
                        <PlayerStats player1="Muma" player2="sinatraa"/>
                    </Grid>

                    <Grid item justify="center">
                        <TextField
                          id="player2"
                          label="Player 2"
                          margin="normal"
                          defaultValue={this.state.player}
                        />
                        {this.state.players.map((item, index) => {
                            if(item.Name === document.getElementById("player2").value) {
                                return <Card key={1} player={item}>{JSON.stringify(item)}</Card>
                            }
                        })}
                    </Grid>
                </Grid>
                



                
            </Fragment>
        );
    }
}

export default withStyles(styles)(ComparePlayers);
